import './Footer.css';

const Footer = () => {
    return (
        <div className="footer">
            <div className="icons">
                <FaTwitter size={30} />
            </div>
            <div>
                <FaGithub size={30} />
            </div>
            <div>
                <FaLinkedin size={30} />
            </div>
            <p className="copyright">
                RoseAshTech © 2021 LLC. All Rights Reserved
            </p>
        </div >
    )
}

